import React from 'react'

type Props = {}

const MainPage = (props: Props) => {
  return (
    <div className='main-page'>
        <div className="main-content">
            <div className="logo">
                <h1>SynthPiser</h1>
            </div>
            <p className='magic'>Embrace the Melodic Magic Awaiting Your Command!</p>
        </div>
    </div>
  )
}

export default MainPage
